//import logo from './logo.svg';

import React, { Component } from "react";
import "./App.css";

class App extends Component {
    render() {
        return (
            <div className="img">

              <form>
        <div>
          <label class="block mb-2 text-indigo-500" for="username">Employee Name</label>
          <input id="input" class="truncate" type="search" autocomplete="off" spellcheck="false" role="combobox" aria-controls="matches" placeholder="Search Google or type a URL" aria-expanded="false" aria-live="polite"></input>
        </div>
        <div>
          <label class="block mb-2 text-indigo-500" for="password">Employee Code</label>
        </div>
        <div>          
          <label class="block mb-2 text-indigo-500" for="password">Department</label>
        </div>       
      </form> 


            </div>
        );
    }
}

export default App;
